        given:
            def contiguousArray = new ContiguousArrayV2()
        when:
            def maxLength = contiguousArray.findMaxLength(nums)
        then:
            maxLength == expectedLength
        where:
            nums                       || expectedLength
            [0,1] as int[]             || 2
            [0,1,0] as int[]           || 2
